    {
        id : 1,
        navigationName: 'Shop',
        to:'shop'
    },
    {
        id : 2,
        navigationName: 'Contact',
        to :'contacts'
    },
    {
        id : 3,
        navigationName: 'SignIn',
        to: 'signIn'
    }
]

